import React, { useState } from 'react';
import PopupWithForm from './PopupWithForm';

function InfoTooltip({ name, isOpen, isActiveButtonSubmit, colorButtonSubmitbuttonVisibleControl, isClose, buttonCloseDisable }) {
    return (
        <PopupWithForm
            name={name}
            isOpen={isOpen}
            isClose={isClose}
            validationOptions={isActiveButtonSubmit}
            colorButtonSubmit = {colorButtonSubmit}
        />
    )
}

export default InfoTooltip;
